import React, { useState } from "react";
import { useDispatch, useSelector } from "react-redux";
import { dataActions } from "../../../store/data";
import Classes from "./AddPopup.module.css";

const AddPopup = () => {
  const isOpen = useSelector((state) => state.data.isAddEnabled);
  const dispatch = useDispatch();

  const [formData, setFormData] = useState({
    title: "",
    brand: "",
    category: "",
    description: "",
    discountPercentage: "",
    price: "",
    rating: "",
    stock: "",
    images: null,
  });

  const handleClose = () => {
    dispatch(dataActions.handleAddChange());
  };

  if (!isOpen) {
    return null;
  }

  const handleFormSubmit = (e) => {
    e.preventDefault();
    // Handle the form submission with the form data
    // You can access the form data from the formData object
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevData) => ({
      ...prevData,
      [name]: value,
    }));
  };

  return (
    <div className={Classes.popupOverlay}>
      <div className={Classes.popupContent}>
        <button className={Classes.closeButton} onClick={handleClose}>
          Close
        </button>

        <form onSubmit={handleFormSubmit}>
          <label htmlFor="title">Title:</label>
          <input
            type="text"
            id="title"
            name="title"
            maxLength="50"
            value={formData.title}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="brand">Brand:</label>
          <input
            type="text"
            id="brand"
            name="brand"
            maxLength="50"
            value={formData.brand}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="category">Category:</label>
          <input
            type="text"
            id="category"
            name="category"
            maxLength="50"
            value={formData.category}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="description" className={Classes.description}>Description:</label>
          <textarea
            id="description"
            name="description"
            maxLength="150"
            value={formData.description}
            onChange={handleInputChange}
            required
          ></textarea>

          <label htmlFor="discountPercentage">Discount Percentage:</label>
          <input
            type="text"
            id="discountPercentage"
            name="discountPercentage"
            pattern="[0-9]+%"
            value={formData.discountPercentage}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="price">Price:</label>
          <input
            type="number"
            id="price"
            name="price"
            value={formData.price}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="rating">Rating:</label>
          <input
            type="number"
            id="rating"
            name="rating"
            min="0"
            max="5"
            value={formData.rating}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="stock">Stock:</label>
          <input
            type="number"
            id="stock"
            name="stock"
            value={formData.stock}
            onChange={handleInputChange}
            required
          />

          <label htmlFor="images">Images:</label>
          <input
            type="file"
            id="images"
            name="images"
            accept=".png, .jpg"
            multiple
            required
          />

          <div>
            <button type="submit">Submit</button>
            <button onClick={handleClose}>Cancel</button>
          </div>
        </form>
      </div>
    </div>
  );
};

export default AddPopup;
